import React from 'react';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import Icon from '@material-ui/core/Icon';
import RestoreIcon from '@material-ui/icons/Restore';
import FavoriteIcon from '@material-ui/icons/Favorite';
import LocationOnIcon from '@material-ui/icons/LocationOn';

export default function LabelBottomNavigation() {
  const [value, setValue] = React.useState('recents');

  let view = '';

  function handlePages(newValue) {
    if (newValue === 'recents') {
      view = <div>Recents</div>
    } else if (newValue === 'favorites') {
      view = <div>Favorites</div>
    } else if (newValue === 'nearby') {
      view = <div>nearby</div>
    } else if (newValue === 'folder') {
      view = <div>Folder</div>
    }
  }

  function handleChange(event, newValue) {
    setValue(newValue);
    handlePages(newValue);
  }
  return (
    <div>
      <div dangerouslySetInnerHTML={{__html: view }} />;
      <BottomNavigation value={value} onChange={handleChange} page={value}>
        <BottomNavigationAction label="Recents" value="recents" icon={<RestoreIcon />} />
        <BottomNavigationAction label="Favorites" value="favorites" icon={<FavoriteIcon />} />
        <BottomNavigationAction label="Nearby" value="nearby" icon={<LocationOnIcon />} />
        <BottomNavigationAction label="Folder" value="folder" icon={<Icon>folder</Icon>} />
      </BottomNavigation>
    </div>
  );
}
